#include <stdio.h>


int main(){

    int i;
    int pos[]={0,0};
    char tab[]="";
    
    
        for(i=0;i<7919;i++){
    
        if(tab[i]=='E'){
            pos[0]++;
        }
        if(tab[i]=='O'){
            pos[0]--;
        }
        if(tab[i]=='N'){
            pos[1]++;
        }
        if(tab[i]=='S'){
            pos[1]--;
        }
        printf("Pos: %c - (%d,%d)\n",tab[i],pos[0],pos[1]);
    }
    printf("Les coordonnÃ©es sont: (%d,%d) \n",pos[0],pos[1]);
    return 0;
}
